    return (
        <div>
        <div className='item'>
    <div className='date'>
        <div className='month'>月份</div>
        <div className='day'>20</div>
    </div>


    <div className="content">
        <h2 className="desc">中文-letter</h2>
        <div className='time'>30分钟</div>
    </div>


    </div>
    </div>
    );
    };


export default Logitem;
